import React from 'react'
import { getCountries } from '../API'

const itemData = [
    {
        span: "Strain",
        p: "SARS-CoV-2"
    },
    {
        span: "Symptoms",
        p: "Fever, Cough, Fatigue"
    },
    {
        span: "Usual onset",
        p: "2–14 days "
    },


]


export default function Headtitle(countries) {
    return (
        <div className="items">
            <div className="item">
                {itemData.map((itemData, index) =>
                    <div key={index} className="item_list" >
                        <span>
                            {itemData.span}
                        </span>
                        <p>
                            {itemData.p}
                        </p>
                    </div>
                )}
                <select className='tests'>
                    let result = '';
                    {countries.forEach(({ c }) => (
                        <option >
                            {c.Country}
                        </option>
                    ))}
                </select>
            </div>
        </div>
    )
}
